(1, 2, 2, 'Moodle updates are available (https://learnuat.zinghr.com/LMS_2_0)', 'Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.8.2 (Build: 20200309) Version 2019111802 (Stable version)\n\nSee https://learnuat.zinghr.com/LMS_2_0/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nYour Moodle site https://learnuat.zinghr.com/LMS_2_0 is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n', 2, '<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.8.2 (Build: 20200309)</strong> Version 2019111802 (Stable version)</li>\n</ul>\n<p>See <a href=\"https://learnuat.zinghr.com/LMS_2_0/admin/index.php\">https://learnuat.zinghr.com/LMS_2_0/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"https://learnuat.zinghr.com/LMS_2_0\">https://learnuat.zinghr.com/LMS_2_0</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>', 'Update notifications', 'moodle', 'availableupdate', NULL, NULL, NULL, 1583782228, NULL),
(2, 2, 2, 'Moodle updates are available (https://learnuat.zinghr.com/LMS_2_0)', 'Update notifications\n\nThere is a newer version for some of your plugins available!\nJitsi (mod_jitsi) There is a new version 2020031100 available!\n\nSee https://learnuat.zinghr.com/LMS_2_0/admin/plugins.php for more details\n\nYour Moodle site https://learnuat.zinghr.com/LMS_2_0 is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n', 2, '<h1>Update notifications</h1>\n<h2>There is a newer version for some of your plugins available!</h2>\n<ul>\n<li><strong>Jitsi</strong> (mod_jitsi) There is a new version 2020031100 available!</li>\n</ul>\n<p>See <a href=\"https://learnuat.zinghr.com/LMS_2_0/admin/plugins.php\">https://learnuat.zinghr.com/LMS_2_0/admin/plugins.php</a> for more details</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"https://learnuat.zinghr.com/LMS_2_0\">https://learnuat.zinghr.com/LMS_2_0</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>', 'Update notifications', 'moodle', 'availableupdate', NULL, NULL, NULL, 1583955005, NULL),
